import React from 'react'

import { CardContainer, HeadingContainer, Heading, CardImage } from './ProjectCard.styles'

const ProjectCard = props => {
  return (
    <div>
    <HeadingContainer>
    <Heading>{props.name}</Heading>
    </HeadingContainer>
    <CardContainer>
    <CardImage src={props.source} />
    </CardContainer>
    </div>
  )
}

export { ProjectCard }
